Wonders of the Universe: Learning Shorts

Science Documentary hosted by Brian Cox, published by BBC in 2011 - English narration


Information
------------------------------

In this compilation of 12 short films, Professor Brian Cox witnesses the wonders of the universe through some of the most breathtaking environments on Earth. In the process, he reveals how the most fundamental scientific principles and laws explain not only the story of the universe, but the story of us all.

